import React from 'react';

function LandingPage(): JSX.Element {
    function findPoint(cx: number, cy: number, rad: number, cornerGrad: number) {
        const cornerRad = (cornerGrad * Math.PI) / 180;
        const nx = Math.cos(cornerRad) * rad + cx;
        const ny = Math.sin(cornerRad) * rad + cy;
        return { x: nx, y: ny };
    }

    const newPoint1 = findPoint(400, 400, 100, 0);
    const newPoint2 = findPoint(400, 400, 100, 60);
    const newPoint3 = findPoint(400, 400, 100, 120);
    const newPoint4 = findPoint(400, 400, 100, 180);

    return (
        <>
            <svg viewBox="0 0 1000 1000">
                {/* center circle */}
                <circle cx="400" cy="400" r="100" stroke="blue" fill="none" />
                {/* center circle */}
                <circle cx={newPoint1.x} cy={newPoint1.y} r="100" stroke="blue" fill="none" />
                <circle cx={newPoint2.x} cy={newPoint2.y} r="100" stroke="blue" fill="none" />
                <circle cx={newPoint3.x} cy={newPoint3.y} r="100" stroke="blue" fill="none" />
                <circle cx={newPoint4.x} cy={newPoint4.y} r="100" stroke="blue" fill="none" />
                {/*<circle cx="400" cy="500" r="100" stroke="blue" fill="none" />
                <circle cx="300" cy="350" r="100" stroke="blue" fill="none" />
                <circle cx="500" cy="350" r="100" stroke="blue" fill="none" />
                <circle cx="300" cy="450" r="100" stroke="blue" fill="none" />
                <circle cx="500" cy="450" r="100" stroke="blue" fill="none" /> */}
            </svg>
            <div>Landing page</div>
        </>
    );
}

export default LandingPage;
